import React from 'react'
import { Link } from '../routes'

const CardContent = ({}) => (

    <div className="card card-image"
         style={{backgroundImage: "url(https://mdbootstrap.com/img/Photos/Horizontal/Work/4-col/img%20%2814%29.jpg)"}}>
        <style jsx>{` 
            h3 {
                color: #393939;
                font-size: 18px;
                font-weight: 500;
                line-height: 1.2em;
                margin-bottom: 8px;
                margin-top: 0;
            }
            li {
                border: none;
                color: #717171;
                display: block;
                font-size: 14px;
                padding: 4px 0;
                -webkit-transition: color .3s;
                transition: color .3s;
            }
            li::before{
                content: "- "
            }
            ul {
                padding: 0 8px;
            }
            
            
        `}</style>

        <div className="text-white text-center d-flex align-items-center rgba-black-strong py-5 px-4">
            <div>
            <h5 className="pink-text"><i className="fas fa-chart-pie"></i> Marketing</h5>
        <h3 className="card-title pt-2"><strong>This is the card title</strong></h3>
        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Repellat fugiat, laboriosam,
            voluptatem.</p>
        <a className="btn btn-pink"><i className="fas fa-clone left"></i> View project</a>
        </div>
        </div>
    </div>
)

export default CardContent
